import IronBootsImg from './iron-boots.png';

const IronBoots = {
    name: 'Iron Boots',
    type: 'armor::boots',
    effect: {
        defence: 4,
    },
    image: IronBootsImg,
    value: 50,
};

export default IronBoots;
